import React from 'react'
import ReactDOM from 'react-dom';

class Form extends React.Component {
    constructor(props) {
        super(props);
        this.state = {nombre: '', apellido: ''};


        this.handleInputChange = this.handleInputChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);

    }

    handleInputChange(event) {
        const name = event.target.name;
        this.setState({
            [name]: event.target.value
        });
    }

    handleSubmit(event) {
        console.log(this.state)
        alert('Se cargó el nombre y apellido: ' + this.state.nombre + ' ' + this.state.apellido);
        event.preventDefault();
    }

    render() {
        return(
            <form onSubmit={this.handleSubmit}>
                <label>
                    Nombre: 
                    <input id="nombre" name="nombre" type="text" value={this.state.name} onChange={this.handleInputChange} />
                </label>
                <label>
                    Apellido: 
                    <input id="apellido" name="apellido" type="text" value={this.state.apellido} onChange={this.handleInputChange} /> 
                </label>
                <input type="submit" value="Enviar" />
            </form>
        );
    }
}

export default Form;
